import React from 'react';
import styled from 'styled-components';
import Home from './Icons';

const Nav = styled.div`
    width: 100vw;
    height: 40px;
    padding-left: 50px;
    background: white;
    box-shadow: 0px 3px 4px #707070;
    position: absolute;
    margin-top: 0;
    display: flex;
    align-items: center;
`;

const Navbar = () => {
    return (
        <Nav>
            <Home />
        </Nav>
    );
};

export default Navbar;
